import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Join from "./component/Join/Join";
import Chat from "./component/Chat/Chat"




function App() {

  return (
    <Routes>
      <Route exact path="/" element={<Join />} />
      <Route path="/chat" component={Chat} />
    </Routes>
  );
}

export default App;
